import React from 'react';
import styles from './deep.module.css'; // Import CSS module

const Deep = () => {
  return (
    <div className={styles.menuContainer}>
      <ul className={styles.verticalNav}>
        <li>
          <a href="#"><i data-feather="activity"></i></a>
          <div className={styles.hoverMenu}>
            <ul>
              <li><a href="#">Menu Item</a></li>
              <li><a href="#">Menu Item</a></li>
              <li><a href="#">Menu Item</a></li>
              <li className={styles.menuHeader}>OTHER</li>
              <li><a href="#">Menu Item</a></li>
              <li><a href="#">Menu Item</a></li>
            </ul>
          </div>
        </li>
        {/* Repeat similar structure for other menu items */}
      </ul>
    </div>
  );
};

export default Deep;
